(38, 'විශ්වවිද්‍යාල සෞඛ්‍ය මධ්‍යස්ථානය', 'අපගේ සෞඛ්‍ය සේවා සඳහා ලියාපදිංචි නොකිරීමේදී ඔබට බලපෑම් සිදු විය හැක.\r\nඅවශ්‍යතා සම්පූර්ණ කිරීමට වහාම පිවිසෙන්න.\r\n\r\nදිනය: 2024 අක්තැම්බර් 27', 1, '2024-10-23 06:50:38'),
